import React from 'react';
import {Link} from 'react-router-dom'
const CardComponent = (props)=>{
    return(
        <div className="card-component"> 
            <img  src="../../example-card-img.png"/>    
            <p className="card-component__title">Przepiękna sala weselna na 250 osób</p>
            <Link className="card-component__button" to="/" className='card-component-button'>Zobacz zdjęcia</Link>
        </div>
    );
}
export default CardComponent
